import React from 'react';
import "./ContactForm.css"

const ContactForm = () => {
  return (
    <div className='contact-form-container'>
        <h2> Write us how we can serve you </h2>
        <p> Fill out the form below and we will get back to you shortly. </p>
        <form>
            <input className='first-name' type="text" name='firstName' placeholder='First Name' />
            <input className='last-name' type="text" name='lastName' placeholder='Last Name' />
            <input className='email' type="email" name='email' placeholder='Email'/>
            <input className='' type="tel" name='telephone' placeholder='Telephone/Mobile' />
            <textarea name="" id="" cols="30" rows="10"></textarea>
        </form>
    </div>
  )
}

export default ContactForm;
